import React from 'react';
import './StatusSummaryCard.css';

const StatusSummaryCard = ({ paid, pending, overdue }) => (
  <div className="status-summary-card">
    <div className="status-item paid">
      <div className="status-value">{paid}</div>
      <div className="status-label">مدفوع</div>
    </div>
    <div className="status-item pending">
      <div className="status-value">{pending}</div>
      <div className="status-label">معلق</div>
    </div>
    <div className="status-item overdue">
      <div className="status-value">{overdue}</div>
      <div className="status-label">متأخر</div>
    </div>
  </div>
);

export default StatusSummaryCard;
